&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;em&gt;A Phenomenology of the Alien: Encounters with the Weird and Inscrutable Other &lt;/em&gt;considers both literal and figurative experiences of the alien from a psychological, psychoanalytic and philosophical perspective.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;Throughout the book, the authors wrestle with the unexplained, ineffable, unspeakable, sublime, uncanny, abject and Miéville’s abcanny. This collection provides phenomenologies of encounters with the inscrutably alien from lights in the sky, dark corners of Weird fictional landscapes, architecture, technology, or the clinical symptom. The chapters examine fictional and nonfictional encounters with what exceeds the capacity to “make sense,” taking a new approach to the topic of alterity and inviting the reader to examine how these encounters reflect our contemporary condition culturally, individually, clinically, theologically and philosophically.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;Bridging cultural, psychoanalytic, literary, clinical, media, and religious studies, the novel approaches in this volume will be of interest to students and scholars alike.&lt;/div&gt;
